const Index = () => {
  return (
    <div className="main">
      <ul className="messages"></ul>
      <input />
      <button>SEND</button>
      <style jsx>{`
        .main {
          border: 1px black solid;
          border-radius: 10px;
          background-color: aqua;
          height: 100vh;
          width: 50%;
        }
      `}</style>
    </div>
  );
};

export default Index;
